	      /* eslint-disable no-param-reassign, prefer-rest-params */
	      deprecate('The method signature getUpdates(timeout, limit, offset) has been deprecated since v0.25.0');
	      form = {
	        timeout: arguments[0],
	        limit: arguments[1],
	        offset: arguments[2],
	      };
